import React from "react";
import './Projects.css';

class Projects extends React.Component {
	render(){
		return(
			<main className="Projects" style={{paddingTop: 12+'rem'}}>
				<h1 className="my-tagline">Recent Projects</h1>
				<div className="project-list">
				<div className="project-item" style={{backgroundColor: 'rgba(111,39,10,.9)'}}>

					</div>
					<div className="project-item" style={{backgroundColor: 'rgba(30,111,44,.9)'}}>

					</div>
					<div className="project-item" style={{backgroundColor: 'rgba(10, 61, 98, .9)'}}>

					</div>
					<div className="project-item" style={{backgroundColor: 'rgba(183, 21, 64, .9)'}}>

					</div>

				</div>
			</main>
		)
	}
};

export default Projects;
